import logo from './logo.svg';
import './App.css';
import React,{ Component, useState, useEffect } from 'react';
import axios from 'axios';
import {BrowserRouter as Router,Switch,Route,Link} from "react-router-dom";
import Sn from './sn';
class App extends Component{


selecetedFile = event=>{
this.setState({
selecetedFile: event.target.files[0]
})
}

dosyaUpload= () =>{
const fd = new FormData();
fd.append('image',this.state.selecetedFile,this.state.selecetedFile.name);
axios.post("/upload",fd);

}


render(){ return(
    <BrowserRouter>
    <div className="App">

<input type="file" onChange={this.selecetedFile}/>
<button onClick={this.dosyaUpload}>Upload</button>

</div>
    </BrowserRouter>);


}





}
export default App;
